import React from 'react';
import './App.css';
import { Container, Row, Card } from 'react-bootstrap';
import NavigationBar from './Components/NavigationBar';

function App() {
  return (
    <div className="App">
      <NavigationBar />
      <Container>
        <Row>
          <Card>
            <Card.Body>
              <Card.Title>Hello World!</Card.Title>
              <Card.Text>
                Ceci est le corps de la page.
              </Card.Text>
            </Card.Body>
          </Card>
        </Row>
      </Container>
    </div>
  );
}

export default App;
